Hey <@U053R6A99K5>! Thanks for reaching out.

First, take a look at our <https://docs.greatexpectations.io/docs/tutorials/quickstart/|Quickstart guide> for a quick overview.

Then, take a look at<https://docs.greatexpectations.io/docs/guides/connecting_to_your_data/fluent/database/how_to_connect_to_sql_data| this doc >to get connected;

<https://docs.greatexpectations.io/docs/guides/connecting_to_your_data/fluent/database/how_to_connect_to_a_sql_table|This doc> to create a data asset from your data;

And <https://docs.greatexpectations.io/docs/guides/expectations/how_to_create_and_edit_expectations_with_instant_feedback_from_a_sample_batch_of_data|this doc> to start setting expectations against your data.

Finally, see <https://docs.greatexpectations.io/docs/guides/validation/checkpoints/how_to_create_a_new_checkpoint/|this doc> to validate your data.

